(2478, 'Eglise Saint-Denis', '2017-09-16 16:00:00', 'Edifice construit au début du XVIIIe par l\'architecte Charles Augustin Daviler. Au XIXe, agrandissement du chœur et des croisillons et construction de bas-côtés et de quatre chapelles.', 51, NULL, 2603, 'http://cibul.s3.amazonaws.com/event_eglise-saint-denis_915_968534.jpg', 'wintheiser.maudie', 'aid'),
